        this["Func_convert_ArgDesc_1"] = "Jednostka, w której podano liczbę.\r\n    \r\nJednostki masy i ciężaru: 'g' = gram; 'sg' = slug; 'lbm' = funt masy (avoirdupois); 'u' = U (jednostka masy atomowj); 'ozm' = uncja masy (avoirdupois)\r\nJednostki odległości: 'm' = metr; 'mi' = mila lądowa; 'Nmi' = mila morska; 'in' = cal; 'f' = stopa; 'yd' = jard; 'ang' = Angstrem; 'Pica' = Cycero (1/72 cala)\r\nJednostki czasu: 'yr' = rok; 'day' = dzień; 'hr' = godzina; 'mn' = minuta; 'sec' = sekunda\r\nJednostki ciśnienia: 'Pa' (lub 'p') = Pascal; 'atm' (lub 'at') = Atmosfera; 'mmHg' = milimetry słupa rtęci\r\nJednostki siły: 'N' = niuton; 'dyn' (lub 'dy') = Dyna; 'lbf' = funt siły\r\nJednostki energii: 'J' = dżul; 'e' = Erg; 'c' = kaloria termodynamiczna; 'cal' = kaloria międzynarodowa; 'eV' (lub 'ev') = elektronowolt; 'HPh' (lub 'hh') = koniogodzina; 'Wh' (lub 'wh') = watogodzina; 'flb' = stopofunt; 'BTU' (lub 'btu') = Brytyjska jednostka ciepła\r\nJednostki mocy: 'HP' (lub 'h') = Koń mechaniczny; 'W' (lub 'w') = Watt\r\nJednostki pola magnetycznego: 'T' = Tesla; 'ga' = Gauss\r\nJednostki temperatury: 'C' (lub 'cel') = stopień Celsjusza; 'F' (lub 'fah') = stopień Fahrenheita; 'K' (lub 'kel') = Kelwin\r\nJednostki objętości płynów: 'tsp' = Łyżeczka; 'tbs' = Łyżka stołowa; 'oz' = Uncja objętości; 'cup' = Kubek; 'pt' (lub 'us_pt') = Półkwarta amerykańska; 'uk_pt' = Półkwarta brytyjska; 'qt' = Kwarta; 'gal' = Galon; 'l' (lub 'lt') = Litr\r\n\r\nKażda jednostka metryczna może być poprzedzona jednym z następujących prefiksów: eksa ('E') = 1E+18; peta ('P') = 1E+15; tera ('T') = 1E+12; giga ('G') = 1E+09; mega ('M') = 1E+06; kilo ('k') = 1E+03; hekto ('h') = 1E+02; deka ('e') = 1E+01; decy ('d') = 1E-01; centy ('c') = 1E-02; milli ('m') = 1E-03; mikro ('u') = 1E-06; nano ('n') = 1E-09; pico ('p') = 1E-12; femto ('f') = 1E-15; atto ('a') = 1E-18\r\n    ";
